import React from 'react';
import ReturnAcTif from './Actif';

import { auth } from '../firebase';
import HmDash from '../Hm/Main';
import BarLoader from 'react-spinners/BarLoader';

// Return Actif
export default function ActiF() {

 const user = auth.currentUser;
 const [loading, setLoading] = React.useState(true);
 const [people, setPeople] = React.useState(user);

 React.useEffect(() => {

  // setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

  if (user) {
   setTimeout(() => {
    setPeople(true);
   }, 600);

  }

 }, []);

 return (
  <div>
   {loading && <div className='App-loading-Actif'></div>}
   {loading && <div className='App-Icon'>
    <BarLoader
     size={15}
     color={'#00b8d4'}
     loading={loading}
    />
   </div>}

   <>
    {people ? <ReturnAcTif /> : <HmDash />}
   </>
  </div>
 );
};
